var dif = [];
for(const pozo of pozos){
  var existe = false;
  for(const nomb of nombresV4) {
    if(pozo.nombre === nomb){
      existe = true;
    }
  }
  if(existe) {
    dif.push(pozo)
  }
}

// file system module to perform file operations
const fs = require('fs');

var jsonContent = JSON.stringify(dif);

fs.writeFile("pozos-v4.json", jsonContent, 'utf8', function (err) {
  if (err) {
    console.log("An error occured while writing JSON Object to File.");
    return console.log(err);
  }

  console.log("JSON file has been saved.");
});